setFetchMethod(url => {
     let headers = new Headers()
     headers.append('Access-Control-Allow-Origin', '*')

     return window.fetch(url, {
       headers,
       mode: 'no-cors',
     })
   })

   enableDarkMode({
     brightness: 100,
     contrast: 90,
     sepia: 10,
   })
